       <!-- /m_editable -->
       <!-- m_editable region-id="editable-static-tag-U20759-BP_infinity" template="contacto-inversionista.html" data-type="html" data-ice-options="disableImageResize,link" -->
       <div class="clearfix grpelem shared_content" id="u20759-10" data-muse-uid="U20759" data-muse-type="txt_frame" data-content-guid="u20759-10_content"><!-- content -->
        <ul class="list0 nls-None" id="u20759-3">
         <li id="u20759-2">Ser parte del desarrollo de proyectos productivos innovadores en el sector agroalimentario del país.</li>
        </ul>
        <p id="u20759-4">&nbsp;</p>
        <ul class="list0 nls-None" id="u20759-7">
         <li id="u20759-6">Ser parte de la transformación de vidas de jóvenes emprendedores con ideas que transforman la realidad del campo y toda la cadena alimentaria.</li>
        </ul>
        <p id="u20759-8">&nbsp;</p>
       </div>
