       <p id="u20787">&nbsp;</p>
       <ul class="list0 nls-None" id="u20787-4">
        <li id="u20787-3">Inversores de capital y de pasivo.</li>
       </ul>
       <p id="u20787-5">&nbsp;</p>
       <ul class="list0 nls-None" id="u20787-8">
        <li id="u20787-7">Rentabilidad por encima del 22% anual.</li>
       </ul>
       <p id="u20787-9">&nbsp;</p>
       <ul class="list0 nls-None" id="u20787-12">
        <li id="u20787-11">Retornos de inversión con un horizonte de 3 a 5 años.</li>
       </ul>
       <p id="u20787-13">&nbsp;</p>
       <ul class="list0 nls-None" id="u20787-16">
        <li id="u20787-15">Liquidez en la salida de los proyectos.</li>
       </ul>
       <p id="u20787-17">&nbsp;</p>
       <ul class="list0 nls-None" id="u20787-20">
        <li id="u20787-19">Información periódica mensual del desarrollo de la inversión o acorde a las necesidades de la inversión.</li>
       </ul>
       <p id="u20787-21">&nbsp;</p>
       <ul class="list0 nls-None" id="u20787-24">
        <li id="u20787-23">Visitas a las empresas promovidas para que conozcan el lugar de sus inversiones.</li>
       </ul>
       <p id="u20787-25">&nbsp;</p>
