        <ul class="list0 nls-None" id="u20763-3">
         <li id="u20763-2">Ser parte de un ciclo innovador de rentabilidad sustentable mediante el actuar ético de los emprendedores, inversores y Etic@pital.</li>
        </ul>
        <p id="u20763-4">&nbsp;</p>
        <ul class="list0 nls-None" id="u20763-7">
         <li id="u20763-6">Garantizamos el sano desarrollo de los negocios promovidos, aprovechando la sinergia de una buena dirección y comerciales.</li>
